describe("Tower.Store.Operators", function() {
  var o, r, t;
  o = Tower.Store.Operators;
  r = null;
  t = null;
  test('eq', function() {
    assert.isTrue(o.eq(1, 1), '1 === 1');
    assert.isTrue(o.eq(1, 1.0), '1 === 1.0');
    assert.isTrue(o.eq(new Date, new Date), 'now === now');
    assert.isTrue(o.eq(/asdf/, "/asdf/"), '/asdf/ === "/asdf/"');
    assert.isTrue(o.eq("/asdf/", /asdf/), '"/asdf/" === /asdf/');
    assert.isTrue(o.eq(null, null), 'null === null');
    assert.isTrue(o.eq(void 0, void 0), 'undefined === undefined');
    assert.isTrue(o.eq(0, 0), '0 === 0');
    assert.isFalse(o.eq(null, void 0), 'null === undefined');
    assert.isFalse(o.eq(void 0, null), 'undefined === null');
    assert.isFalse(o.eq(0, null), '0 === null');
    assert.isFalse(o.eq(0, void 0), '0 === undefined');
    assert.isFalse(o.eq(1, '1'), '1 === "1"');
    assert.isFalse(o.eq(1, 1.1), '1 === 1.1');
    assert.isFalse(o.eq(new Date, _(3).days().ago().toDate()), 'now === ago');
    return assert.isFalse(o.eq(/asdf/, "asdf"), '/asdf/ === "asdf"');
  });
  test('neq', function() {
    assert.isTrue(o.neq(null, void 0), 'null === undefined');
    assert.isTrue(o.neq(void 0, null), 'undefined === null');
    assert.isTrue(o.neq(0, null), '0 === null');
    assert.isTrue(o.neq(0, void 0), '0 === undefined');
    assert.isTrue(o.neq(1, '1'), '1 === "1"');
    assert.isTrue(o.neq(1, 1.1), '1 === 1.1');
    assert.isTrue(o.neq(new Date, _(3).days().ago().toDate()), 'now === ago');
    assert.isTrue(o.neq(/asdf/, "asdf"), '/asdf/ === "asdf"');
    assert.isFalse(o.neq(1, 1), '1 === 1');
    assert.isFalse(o.neq(1, 1.0), '1 === 1.0');
    assert.isFalse(o.neq(new Date, new Date), 'now === now');
    assert.isFalse(o.neq(/asdf/, "/asdf/"), '/asdf/ === "/asdf/"');
    assert.isFalse(o.neq("/asdf/", /asdf/), '"/asdf/" === /asdf/');
    assert.isFalse(o.neq(null, null), 'null === null');
    assert.isFalse(o.neq(void 0, void 0), 'undefined === undefined');
    return assert.isFalse(o.neq(0, 0), '0 === 0');
  });
  describe('gte', function() {
    test('integer', function() {
      assert.isTrue(o.gte(2, 1), '2 >= 1');
      assert.isTrue(o.gte(2, 2), '2 >= 2');
      assert.isTrue(o.gte(2, 0), '2 >= 0');
      assert.isTrue(o.gte(-1, -2), '-1 >= -2');
      assert.isFalse(o.gte(-1, 0), '-1 !>= 0');
      assert.isFalse(o.gte(2, void 0), '2 !>= undefined');
      return assert.isFalse(o.gte(2, null), '2 !>= null');
    });
    return test('date', function() {
      var ago, now;
      now = new Date;
      ago = _(3).days().ago().toDate();
      assert.isTrue(o.gte(now, ago), 'now >= 3.days.ago');
      assert.isTrue(o.gte(now, now), 'now >= now');
      return assert.isFalse(o.gte(ago, now), 'ago !>= now');
    });
  });
  test('gt', function() {
    assert.isTrue(o.gt(2, 1), '2 > 1');
    assert.isTrue(o.gt(2, 0), '2 > 0');
    assert.isTrue(o.gt(-1, -2), '-1 > -2');
    assert.isFalse(o.gt(2, 2), '2 !> 2');
    assert.isFalse(o.gt(-1, 0), '-1 !> 0');
    assert.isFalse(o.gt(2, void 0), '2 !> undefined');
    return assert.isFalse(o.gt(2, null), '2 !>= null');
  });
  test('lte', function() {
    assert.isTrue(o.lte(2, 2), '2 <= 2');
    assert.isTrue(o.lte(-1, 0), '-1 <= 0');
    assert.isFalse(o.lte(2, 1), '2 !<= 1');
    assert.isFalse(o.lte(2, 0), '2 !<= 0');
    assert.isFalse(o.lte(-1, -2), '-1 !<= -2');
    assert.isFalse(o.lte(2, void 0), '2 !<= undefined');
    return assert.isFalse(o.lte(2, null), '2 !<= null');
  });
  test('lt', function() {
    assert.isTrue(o.lt(-1, 0), '-1 < 0');
    assert.isTrue(o.lt(0, 1), '0 < 1');
    assert.isTrue(o.lt(1, 2), '1 < 2');
    assert.isFalse(o.lt(2, 1), '2 !< 1');
    assert.isFalse(o.lt(2, 0), '2 !< 0');
    assert.isFalse(o.lt(-1, -2), '-1 !< -2');
    assert.isFalse(o.lt(2, void 0), '2 !< undefined');
    assert.isFalse(o.lt(2, null), '2 !< null');
    return assert.isFalse(o.lt(2, 2), '2 !< 2');
  });
  test('match', function() {
    assert.isTrue(o.match("asdf", "a"));
    assert.isTrue(o.match("asdf", /a/));
    assert.isFalse(o.match("a", "asdf"));
    return assert.isFalse(o.match("asdf", /A/));
  });
  test('notMatch', function() {
    assert.isTrue(o.notMatch("a", "asdf"));
    assert.isTrue(o.notMatch("asdf", /A/));
    assert.isFalse(o.notMatch("asdf", "a"));
    return assert.isFalse(o.notMatch("asdf", /a/));
  });
  test('anyIn', function() {
    assert.isTrue(o.anyIn(['ruby', 'javascript'], ["javascript"]));
    assert.isTrue(o.anyIn(['ruby', 'javascript'], ["javascript", "node"]));
    assert.isTrue(o.anyIn(['ruby', 'javascript'], ["node", "javascript"]));
    assert.isTrue(o.anyIn(['ruby', 'javascript'], 'javascript'));
    return assert.isFalse(o.anyIn(['ruby', 'javascript'], [".net"]));
  });
  test('matchIn', function() {
    assert.isTrue(o.matchIn([
      {
        a: 1,
        b: 3
      }
    ], {
      a: 1
    }));
    assert.isTrue(o.matchIn([
      {
        a: 1,
        b: 3
      }, 7, {
        b: 99
      }, {
        a: 11
      }
    ], {
      a: 1,
      b: {
        $gt: 1
      }
    }));
    assert.isFalse(o.matchIn([1], {
      a: 1
    }));
    assert.isFalse(o.matchIn([
      {
        a: 2,
        b: 3
      }
    ], {
      a: 1
    }));
    return assert.isTrue(o.matchIn([
      {
        a: 2,
        b: 3
      }
    ], {
      $or: [
        {
          a: 1
        }, {
          b: 3
        }
      ]
    }));
  });
  test('exists', function() {
    assert.isTrue(o.exists(true));
    assert.isTrue(o.exists(false));
    assert.isTrue(o.exists(null));
    assert.isTrue(o.exists(0));
    assert.isTrue(o.exists(1));
    assert.isTrue(o.exists(-1));
    assert.isTrue(o.exists(""));
    assert.isTrue(o.exists("asdf"));
    return assert.isFalse(o.exists(void 0));
  });
  test('size', function() {
    assert.isTrue(o.size(['a', 'b', 'c'], 3));
    assert.isFalse(o.size([], 3));
    return assert.isFalse(o.size('asdf', 4), 'not array');
  });
  test('operators.test(recordValue, operators)', function() {
    assert.isTrue(o.testValue(1, {
      $eq: 1
    }));
    assert.isTrue(o.testValue(1, {
      $neq: 0
    }));
    assert.isTrue(o.testValue(1, {
      $gt: 0,
      $lt: 2
    }));
    assert.isTrue(o.testValue(1, {
      $gt: 0,
      $lt: 1.1
    }));
    assert.isTrue(o.testValue(1, {
      $gt: 0,
      $lte: 1
    }));
    assert.isFalse(o.testValue(1, {
      $gt: 0,
      $lt: 1
    }));
    assert.isTrue(o.testValue('acmeblahcorp', {
      $regex: /acme.*corp/i
    }));
    assert.isTrue(o.testValue('acme-corp', {
      $regex: /acme.*corp/i,
      $nin: ['acmeblahcorp']
    }));
    return assert.isFalse(o.testValue('acmeblahcorp', {
      $regex: /acme.*corp/i,
      $nin: ['acmeblahcorp']
    }));
  });
  return describe('test record', function() {
    beforeEach(function() {
      t = new Date;
      return r = new App.OperatorsTest({
        string: "a string",
        integer: 10,
        float: 12.2,
        date: t,
        object: {
          one: "-one-",
          two: "-two-"
        },
        arrayString: ['a', 'b', 'c'],
        arrayObject: [
          {
            a: 1,
            b: 7
          }
        ]
      });
    });
    test('eq', function() {
      assert.isTrue(o.test(r, {
        string: 'a string'
      }));
      assert.isTrue(o.test(r, {
        integer: 10
      }));
      assert.isTrue(o.test(r, {
        integer: 10.0
      }));
      assert.isFalse(o.test(r, {
        integer: 20
      }));
      assert.isTrue(o.test(r, {
        string: {
          $eq: 'a string'
        }
      }));
      return assert.isTrue(o.test(r, {
        string: {
          '==': 'a string'
        }
      }));
    });
    test('neq', function() {
      assert.isTrue(o.test(r, {
        string: {
          $neq: 'string'
        }
      }));
      return assert.isTrue(o.test(r, {
        string: {
          '!=': 'string'
        }
      }));
    });
    test('match', function() {
      assert.isTrue(o.test(r, {
        string: {
          $match: 'string'
        }
      }));
      assert.isTrue(o.test(r, {
        string: /string/
      }));
      assert.isTrue(o.test(r, {
        string: /strin/
      }));
      return assert.isFalse(o.test(r, {
        string: /asdf/
      }));
    });
    test('gte', function() {
      assert.isTrue(o.test(r, {
        integer: {
          $gte: 5
        }
      }));
      assert.isTrue(o.test(r, {
        integer: {
          '>=': 10
        }
      }));
      return assert.isFalse(o.test(r, {
        integer: {
          '>=': 20
        }
      }));
    });
    test('gt', function() {
      assert.isTrue(o.test(r, {
        integer: {
          $gt: 5
        }
      }));
      assert.isTrue(o.test(r, {
        integer: {
          '>': 7
        }
      }));
      assert.isFalse(o.test(r, {
        integer: {
          '>': 10
        }
      }));
      return assert.isFalse(o.test(r, {
        integer: {
          '>': 20
        }
      }));
    });
    test('anyIn', function() {
      assert.isTrue(o.test(r, {
        arrayString: {
          $anyIn: ['b']
        }
      }));
      assert.isTrue(o.test(r, {
        arrayString: {
          $any: ['b']
        }
      }));
      assert.isTrue(o.test(r, {
        arrayString: {
          $anyIn: ['b', 'x']
        }
      }));
      return assert.isFalse(o.test(r, {
        arrayString: {
          $anyIn: ['x']
        }
      }));
    });
    test('or', function() {
      assert.isTrue(o.test(r, {
        $or: [
          {
            string: 'a string'
          }, {
            integer: 10
          }
        ]
      }), 'both match');
      assert.isTrue(o.test(r, {
        $or: [
          {
            string: 'a string'
          }, {
            integer: 20
          }
        ]
      }), 'first matches');
      assert.isTrue(o.test(r, {
        $or: [
          {
            string: 'asdf'
          }, {
            integer: 10
          }
        ]
      }), 'last matches');
      return assert.isFalse(o.test(r, {
        $or: [
          {
            string: 'asdf'
          }, {
            integer: 20
          }
        ]
      }), 'none match');
    });
    test('nor', function() {
      assert.isTrue(o.test(r, {
        $nor: [
          {
            string: 'asdf'
          }, {
            integer: 20
          }
        ]
      }), 'none match');
      assert.isFalse(o.test(r, {
        $nor: [
          {
            string: 'a string'
          }, {
            integer: 10
          }
        ]
      }), 'both match');
      assert.isFalse(o.test(r, {
        $nor: [
          {
            string: 'a string'
          }, {
            integer: 20
          }
        ]
      }), 'first matches');
      return assert.isFalse(o.test(r, {
        $nor: [
          {
            string: 'asdf'
          }, {
            integer: 10
          }
        ]
      }), 'last matches');
    });
    test('array', function() {
      assert.isTrue(o.test(r, {
        arrayString: {
          $anyIn: ['b']
        }
      }));
      return assert.isFalse(o.test(r, {
        arrayString: {
          $anyIn: ['x']
        }
      }));
    });
    test('elemMatch', function() {
      assert.isTrue(o.test(r, {
        arrayObject: {
          $matchIn: {
            a: 1
          }
        }
      }));
      assert.isTrue(o.test(r, {
        arrayObject: {
          $elemMatch: {
            a: 1
          }
        }
      }));
      assert.isTrue(o.test(r, {
        arrayObject: {
          $matchIn: {
            a: {
              $lte: 2
            }
          }
        }
      }));
      return assert.isFalse(o.test(r, {
        arrayObject: {
          $matchIn: {
            a: 2
          }
        }
      }));
    });
    return describe('select', function() {
      var records;
      records = null;
      beforeEach(function() {
        var i, _results;
        i = 1;
        records = [];
        _results = [];
        while (i <= 20) {
          records.push(new App.OperatorsTest({
            string: "string " + i,
            integer: i
          }));
          _results.push(i++);
        }
        return _results;
      });
      return test('select', function() {
        assert.equal(10, o.select(records, {
          integer: {
            '>': 10
          }
        }).length);
        assert.equal(11, o.select(records, {
          integer: {
            '>=': 10
          }
        }).length);
        assert.equal(9, o.select(records, {
          integer: {
            '<': 10
          }
        }).length);
        assert.equal(10, o.select(records, {
          integer: {
            '<=': 10
          }
        }).length);
        return assert.equal(2, o.select(records, {
          integer: {
            '>=': 10,
            '<=': 11
          }
        }).length);
      });
    });
  });
});
